import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Set viewport to mobile size to trigger mobile menu styles
    await page.setViewportSize({ width: 375, height: 700 });

    // Wait for nav menu trigger (using text and class, as .nav-menu is only visible on mobile)
    await page.waitForSelector('.nav-menu', { state: 'visible', timeout: 5000 });

    // Click the mobile nav menu trigger (should open mobile menu)
    await page.click('.nav-menu');

    // Wait for the mobile menu overlay to appear (using id and class)
    await page.waitForSelector('#mobileMenuOverlay.mobile-menu-overlay.show', { timeout: 5000 });

    // Wait for the mobile menu itself to slide in (using .mobile-menu inside overlay)
    await page.waitForSelector('#mobileMenuOverlay.show .mobile-menu', { timeout: 3000 });

    // Take screenshot of mobile menu open
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_mobile_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_mobile_menu_open.png'));

    // Find a visible category link in the mobile menu (e.g., "Electronics")
    // Use XPath to ensure we get the link inside the mobile menu
    const electronicsLink = await page.waitForSelector(
      'xpath=//div[contains(@class,"mobile-menu") and contains(., "Browse Categories")]//a[contains(text(), "Electronics")]',
      { timeout: 3000 }
    );
    // Extract the text to verify
    const electronicsText = await electronicsLink.textContent();

    // Click the "Electronics" link
    await electronicsLink.click();

    // Wait for loading overlay or main content update (simulate wait for navigation)
    // Wait for the main content to show "Electronics" as a heading
    await page.waitForSelector('h2', { timeout: 5000 });
    const h2s = await page.$$eval('h2', els => els.map(e => e.textContent));
    const foundElectronics = h2s.some(h => h && h.toLowerCase().includes('electronics'));

    // Take screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_electronics_category.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_electronics_category.png'));

    // Open mobile menu again to test close functionality
    await page.click('.nav-menu');
    await page.waitForSelector('#mobileMenuOverlay.mobile-menu-overlay.show', { timeout: 3000 });

    // Wait for close button (using aria-label or text "Ã—" and class)
    const closeBtn = await page.waitForSelector(
      '#mobileMenuOverlay.show .close-mobile-menu', { timeout: 3000 }
    );
    // Click close
    await closeBtn.click();

    // Wait for overlay to disappear
    await page.waitForSelector('#mobileMenuOverlay.show', { state: 'detached', timeout: 3000 });

    // Take screenshot after closing menu
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_menu_closed.png'));

    return {
      success: foundElectronics,
      action: "Tested mobile menu open, navigation to Electronics, and menu close.",
      extractedData: {
        mobileMenuCategoryClicked: electronicsText,
        categoryHeadingFound: foundElectronics
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
